import re, base64

def main():
    with open("in.js", "r") as f:
        with open("out.js", "a+") as out:
            replace_hex_in_file(f, out)
            out.close()
        f.close()

def replace_hex_in_file(f, out):
    hexa_pattern = re.compile(r'"0x[0-9a-f]+"')
    function_pattern = re.compile(r'_securedTouchMetadata_0x56ae\("[0-9]+"\)')
    content = f.read()
    lines_list = content.splitlines()
    for line in lines_list:
        line = re.sub(hexa_pattern, hex_to_denary, line)
        line = re.sub(function_pattern, decode_array, line)
        out.write(f"{line}\n")

def hex_to_denary(match):
    match = match.group()
    just_hex = match.split('"')[1]
    denary_val = int(just_hex, 16)
    return f'"{denary_val}"'
    
def decode_array(match):
    match = match.group()
    index = match.split('"')[1]
    base64_encoded_value = _securedTouchMetadata_0x550c[int(index)]
    decoded_value = base64.b64decode(base64_encoded_value).decode("utf-8") 
    if '"' in decoded_value:
        return f"'{decoded_value}'"
    return f'"{decoded_value}"'

